  true,\n\t\"url\": null,\n\t\"notes\": \"The State Energy Efficient Appliance Rebate
  Program (SEEARP) reports database includes rebate reports (xls) and summary factsheets
  (pdf) from states and territories that participated in SEEARP. With funding provided
  by the American Recovery and Reinvestment Act of 2009 (ARRA), the U.S. Department
  of Energy (DOE) developed SEEARP to spur economic activity and invest in long-term
  energy savings by helping consumers replace older, inefficient appliances with new,
  efficient models. SEEARP provided almost $300 million to the 56 U.S. states and
  territories to support state-level consumer rebate programs for efficient appliances
  from December 1, 2009 to February 17, 2012.rnrnThe successes and challenges of SEEARP
  provide valuable lessons for designing and running a consumer-focused appliance
  rebate program. In addition to the SEEARP reports database two reports provide a
  results and program design lessons.  rn [Program Design Lessons Learned (Volume
  1)](http://energy.gov/eere/buildings/downloads/state-energy-efficient-appliance-rebate-program-volume-1-program-design)
  draws on the insights DOE gathered from its more than 4 years of administering SEEARP
  and analyzing the nearly 1.8 million rebates and the associated reporting from the
  56 state and territory programs.  rn [Program Results (Volume 2)](http://energy.gov/eere/buildings/downloads/state-energy-efficient-appliance-rebate-program-volume-2-program-results)
  includes program impacts reports summarizing individual state and overall results\",\n\t\"license_title\":
